// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract PawnContract {
    address public borrower;
    uint public collateralAmount; 
    uint public loanAmount; 
    bool public loanRepaid;

    event LoanReceived(uint amount);
    event LoanRepaid(uint amount);

    constructor() {
        borrower = msg.sender;
        collateralAmount = 4 ether;
        loanAmount = 200;
        loanRepaid = false;
    }

    modifier onlyBorrower() {
        require(msg.sender == borrower, "Only the borrower can call this function");
        _;
    }

    modifier loanNotRepaid() {
        require(!loanRepaid, "Loan has already been repaid");
        _;
    }

    receive() external payable {
        emit LoanReceived(msg.value);
    }

    function repayLoan() external payable onlyBorrower loanNotRepaid {
        require(msg.value == loanAmount, "Incorrect repayment amount");
        loanRepaid = true;
        payable(borrower).transfer(collateralAmount);
        emit LoanRepaid(msg.value);
    }

    function checkStatus() external view returns (address, uint, uint, bool) {
        return (borrower, collateralAmount, loanAmount, loanRepaid);
    }
}

